import React, { Component } from 'react';

import NotifyList from '../components/UI/NotifyList/NotifyList';

class NotifyListContainer extends Component {
  render() {
    return (
      <NotifyList notify={[{text:'text'}]}/>
    );
  }
}

export default NotifyListContainer;
